        var argObj, x, y, w, h;
        if (arguments.length === 1 && $.isPlainObject(name)) {
            argObj = name;
            name = argObj["name"];
            x = argObj["left"];
            y = argObj["top"];
            w = argObj["width"];
            h = argObj["height"]
        };
        x = x || 0;
        y = y || 0;
        w = w || 0;
        h = h || 0;
        x = parseInt(x, 10);
        x = isNaN(x) ? 0: x;
        y = parseInt(y, 10);
        y = isNaN(y) ? 0: y;
        w = parseInt(w, 10);
        w = isNaN(w) ? 0: w;
        h = parseInt(h, 10);
        h = isNaN(h) ? 0: h;
        api.setFrameAttr({
		    name: name,
		    rect: {
		        x: x,
		        y: y,
		        w: w,
		        h: h
		    }
		});
